import {Link} from 'react-router-dom';
import { AppBar, Toolbar, Button, Typography } from "@material-ui/core";
import useStyles from "./styles";

const Navbar = () => {
	const classes = useStyles();
	return (
		<AppBar position="static" className={classes.navBar}>
			<Toolbar>
                <Typography variant="h6">lumunge <br /> <Typography variant="caption">fullstack web developer</Typography></Typography>
				<Button className={classes.navLinks} component={Link} to="/">
					Hello
				</Button>
                <Button className={classes.navLinks} component={Link} to="/resources">
					Resources
				</Button>
                <Button className={classes.navLinks} component={Link} to="/collaborate">
					Collaborate
				</Button>
				<Button className={classes.navLinks} component={Link} to="/about">
					About
				</Button>
                <Button className={classes.navLinks} onClick={() => alert("Opens up email sender to send emails")}>
					Contact
				</Button>

			</Toolbar>
		</AppBar>
	);
};

export default Navbar;
